import { Avatar, Card } from 'antd';

const UserProfile = () => {
  return (
    <>
      <Card
        actions={[
          <div key="twit">
            짹짹
            <br />0
          </div>,
        ]}
      >
        <Card.Meta avatar={<Avatar>ZC</Avatar>} title="eyo25"></Card.Meta>
      </Card>
    </>
  );
};

export default UserProfile;
